defs.script:
var a8_idx;
var a8_on;
var a8_fr;
var a8_btnPauseLeft,a8_btnPlayLeft,a8_btnPauseRight,a8_btnPlayRight;
var a8_playsRight,a8_isPaused,a8_playing;
var a8_int;
var a8_pause,a8_playRight,a8_playLeft,a8_playBwd,a8_playFwd;
var a8_fps,a8_spd;
var a8_setFps;
var a8_seekFrame,a8_gotoNext,a8_gotoPrev;
var a8_stopFirst,a8_stopLast;
var a8_playPauseBwd,a8_playPauseFwd;
var a8_stepBwd,a8_stepFwd;
var a8_spdIncr,a8_spdDecr,a8_spdReset;
(function(){
function onload(){
if(!a8_fr){
a8_fr=new Array();
a8_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==8){
a8_fr[ocgName[1]]=ocg[i];
}
}
a8_btnPauseLeft=document.getElementById('8.PauseLeft');
a8_btnPlayLeft=document.getElementById('8.PlayLeft');
a8_btnPauseRight=document.getElementById('8.PauseRight');
a8_btnPlayRight=document.getElementById('8.PlayRight');
a8_playsRight=true;
a8_isPaused=false;
a8_playing=false;
a8_fps=12;
a8_spd=1;
a8_setFps=function(f){
a8_fps=(f==0?1e-6:f);
if(a8_playing){
if(a8_playsRight){a8_playRight();}else{a8_playLeft();}
}
};
a8_seekFrame=function(f){
if(f>279||f<0){return -1;}
a8_idx=f;
a8_fr[a8_on].setAttribute('visibility','hidden');
a8_fr[f].setAttribute('visibility','visible');
a8_on=f;
return 0;
};
a8_stopFirst=function(){a8_pause(true);a8_seekFrame(0);};
a8_stopLast=function(){a8_pause(true);a8_seekFrame(279);};
a8_gotoNext=function(){
if(a8_seekFrame(a8_idx+1)<0){
a8_stopLast();
}
};
a8_gotoPrev=function(){
if(a8_seekFrame(a8_idx-1)<0){
a8_stopFirst();
}
};
a8_pause=function(stop){
try{clearInterval(a8_int);}catch(e){}
a8_playing=false;
a8_isPaused=!stop;
a8_btnPauseLeft.setAttribute('visibility','hidden');
a8_btnPlayLeft.setAttribute('visibility','visible');
a8_btnPauseRight.setAttribute('visibility','hidden');
a8_btnPlayRight.setAttribute('visibility','visible');
};
a8_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a8_gotoNext()',1000/a8_fps/a8_spd);}catch(e){}
try{clearInterval(a8_int);}catch(e){}
a8_int=tmp_int;
a8_playsRight=true;
a8_playing=true;
a8_isPaused=false;
a8_btnPauseLeft.setAttribute('visibility','visible');
a8_btnPlayLeft.setAttribute('visibility','hidden');
a8_btnPauseRight.setAttribute('visibility','visible');
a8_btnPlayRight.setAttribute('visibility','hidden');
};
a8_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a8_gotoPrev()',1000/a8_fps/a8_spd);}catch(e){}
try{clearInterval(a8_int);}catch(e){}
a8_int=tmp_int;
a8_playsRight=false;
a8_playing=true;
a8_isPaused=false;
a8_btnPauseLeft.setAttribute('visibility','visible');
a8_btnPlayLeft.setAttribute('visibility','hidden');
a8_btnPauseRight.setAttribute('visibility','visible');
a8_btnPlayRight.setAttribute('visibility','hidden');
};
a8_playPauseBwd=function(){if(a8_playing){a8_pause();}else{a8_playBwd();}};
a8_playPauseFwd=function(){if(a8_playing){a8_pause();}else{a8_playFwd();}};
a8_spdIncr=function(){a8_spd*=1.1;a8_setFps(a8_fps);};
a8_spdDecr=function(){a8_spd/=1.1;a8_setFps(a8_fps);};
a8_spdReset=function(){a8_spd=1;a8_setFps(a8_fps);};
a8_stepBwd=function(){if(!a8_playing){a8_seekFrame(a8_idx-1);a8_isPaused=true;}};
a8_stepFwd=function(){if(!a8_playing){a8_seekFrame(a8_idx+1);a8_isPaused=true;}};
a8_playBwd=function(){if(a8_idx==0){a8_stopLast();}a8_playLeft();};
a8_playFwd=function(){if(a8_idx==279){a8_stopFirst();}a8_playRight();};
a8_seekFrame(0);
}
document.getElementById('anm8').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm8').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm8').addEventListener('touchend',onTouchEndWdgt);
onvisible();
}
function onvisible(){
if(a8_playsRight){a8_playFwd();}else{a8_playBwd();}
}
function onhidden(){
if(a8_playing){a8_pause(true);}
if(!a8_isPaused)a8_playsRight=true;
if(!a8_isPaused&&a8_idx!=0)a8_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
function onWidgetUpAction(event){
try{
if(event.shiftKey)a8_playsRight=!a8_playsRight;
var doplay=true;
if(a8_idx==279&&a8_playsRight){a8_stopFirst();}
if(a8_idx==0&&!a8_playsRight){a8_stopLast();}
if(doplay){if(a8_playsRight){a8_playRight();}else{a8_playLeft();}}
}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();event.stopPropagation();
if(a8_playing){try{a8_pause();}catch(e){}}else{
try{
if(event.shiftKey)a8_playsRight=!a8_playsRight;
var doplay=true;
if(a8_idx==279&&a8_playsRight){a8_stopFirst();}
if(a8_idx==0&&!a8_playsRight){a8_stopLast();}
if(doplay){if(a8_playsRight){a8_playRight();}else{a8_playLeft();}}
}catch(e){}
}
}
function onMouseDownWdgt(event){
event.preventDefault();event.stopPropagation();
try{if(a8_playing){a8_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();event.stopPropagation();
onWidgetUpAction(event);
}
})();
